import React from "react";
import { render } from "react-dom";
const Weather = (props) => (
	<div> 
            { props.city &&
            	<div>
            <p>Местоположение: {props.city}, {props.country}</p>
            <p>Температура: {props.temp}</p>
            <p>Давление: {props.pressure}</p>
            <p>Заход солнца: {props.sunset}</p>
            </div>

             }
             <p>{props.error}</p>

            </div >
            );

export default Weather;
